      <div className="container">
        <PageHeader>Real App Home Page</PageHeader>
        <div className="row">
          <div className="col-12">
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Ipsa,
              iste!
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
